import React, {Component} from "react";
import "./city.scss";


class City extends Component {
    render() {
        let style = {
            position: "absolute",
            left: "${this.props.left}",
            top: "${this.props.top}"
        };
        return (
                <div style={style}>{this.props.name}</div>
        )
    }
}

export default City;
